import logo from "./logo.svg";
import "./App.css";

function MyButton() {
    this.state = {
      buttonText: 'Click me!',
    };

  handleClick = () => {
    this.setState({
      buttonText: 'Clicked!',
    });
  };

    return (
      <button onClick={this.handleClick}>
        {this.state.buttonText}
      </button>
    );
  }

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Hello World</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      MyButton
    </div>
  );
}

export default App;
